{
    "sql": "select ds.*,ds1.ParentId,seq.Id as GroupFeatureId from FeaturePolicy as ds left join Feature ds1 on ds.FeatureId = ds1.Id left join Feature ds2 on ds1.ParentId = ds2.Id outer apply (select top 1 * from FeaturePolicy where FeatureId = ds1.ParentId and RoleId = ds.RoleId) seq where ds.RoleId = '{RoleId}' and ds1.ParentId is not null and seq.Id is not null",
    "total": "select count(ds.Id) as total from FeaturePolicy as ds left join Feature ds1 on ds.FeatureId = ds1.Id left join Feature ds2 on ds1.ParentId = ds2.Id outer apply (select top 1 * from FeaturePolicy where FeatureId = ds1.ParentId and RoleId = ds.RoleId) seq where ds.RoleId = '{RoleId}' and ds1.ParentId is not null and seq.Id is not null"
}

